import {useParams} from "react-router-dom";
import {useEffect, useState} from "react";

export default function Paginator({pagesCount, baseLink}) {
    const inactiveLinkClass = "flex items-center justify-center px-4 h-10 leading-tight text-gray-500 bg-white border border-gray-300 hover:bg-gray-100 hover:text-gray-700 dark:bg-gray-800 dark:border-gray-700 dark:text-gray-400 dark:hover:bg-gray-700 dark:hover:text-white";
    const activeLinkClass = "flex items-center justify-center px-4 h-10 text-blue-600 border border-gray-300 bg-blue-50 hover:bg-blue-100 hover:text-blue-700 dark:border-gray-700 dark:bg-gray-700 dark:text-white";
    const params = useParams();
    const [links, setLinks] = useState([]);

    useEffect(() => {
        let page = 1;
        if (params.page) {
            page = params.page;
        }

        let links = [];

        for(let i = 1;i <= pagesCount;i++) {
            let href = baseLink + "?page=" + i;
            if (i == page) {
                links.push(
                    <li>
                        <a href={href} aria-current="page" className={activeLinkClass}>i</a>
                    </li>
                );
            } else {
                links.push(
                    <li>
                        <a href={href} className={inactiveLinkClass}>i</a>
                    </li>
                );
            }

            console.log(links);

            setLinks(links);
        }
    }, []);

    return (
        <>
            <nav aria-label="Page navigation example">
                <ul className="inline-flex -space-x-px text-base h-10">
                    <li>
                        <a href="#" className="flex items-center justify-center px-4 h-10 ms-0 leading-tight text-gray-500 bg-white border border-e-0 border-gray-300 rounded-s-lg hover:bg-gray-100 hover:text-gray-700 dark:bg-gray-800 dark:border-gray-700 dark:text-gray-400 dark:hover:bg-gray-700 dark:hover:text-white">
                            Предыдущая
                        </a>
                    </li>

                    {links.map((link) => {
                        return {link}
                    })}

                    <li>
                        <a href="#" className="flex items-center justify-center px-4 h-10 leading-tight text-gray-500 bg-white border border-gray-300 rounded-e-lg hover:bg-gray-100 hover:text-gray-700 dark:bg-gray-800 dark:border-gray-700 dark:text-gray-400 dark:hover:bg-gray-700 dark:hover:text-white">
                            Следующая
                        </a>
                    </li>
                </ul>
            </nav>
        </>
    );
}
